import{_ as t,c as a,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP OPERATOR CLASS","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_OPERATOR_CLASS.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_OPERATOR_CLASS.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_OPERATOR_CLASS.md"};function n(r,e,d,l,c,p){return o(),a("div",null,e[0]||(e[0]=[s('<h1 id="drop-operator-class" tabindex="-1">DROP OPERATOR CLASS <a class="header-anchor" href="#drop-operator-class" aria-label="Permalink to &quot;DROP OPERATOR CLASS&quot;">​</a></h1><p>Removes an operator class.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP OPERATOR CLASS [IF EXISTS] &lt;name&gt; USING &lt;index_method&gt; [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP OPERATOR</code> drops an existing operator class. To run this command you must be the owner of the operator class.</p><p><code>DROP OPERATOR CLASS</code> does not drop any of the operators or functions referenced by the class. If there are any indexes depending on the operator class, you will need to specify <code>CASCADE</code> for the drop to complete.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the operator class does not exist. A notice is issued in this case.</p><p>name : The name (optionally schema-qualified) of an existing operator class.</p><p>index_method : The name of the index access method the operator class is for.</p><p>CASCADE : Automatically drop objects that depend on the operator class (such as indexes), and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the operator class if any objects depend on it. This is the default.</p><h2 id="notes" tabindex="-1"><a id="section4"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p><code>DROP OPERATOR CLASS</code> will not drop the operator family containing the class, even if there is nothing else left in the family (in particular, in the case where the family was implicitly created by <code>CREATE OPERATOR CLASS</code>). An empty operator family is harmless, but for the sake of tidiness you might wish to remove the family with <code>DROP OPERATOR FAMILY</code>; or perhaps better, use <code>DROP OPERATOR FAMILY</code> in the first place.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the B-tree operator class <code>widget_ops</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP OPERATOR CLASS widget_ops USING btree;</span></span></code></pre></div><p>This command will not succeed if there are any existing indexes that use the operator class. Add <code>CASCADE</code> to drop such indexes along with the operator class.</p><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>DROP OPERATOR CLASS</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_OPERATOR_CLASS.html">ALTER OPERATOR CLASS</a>, <a href="./CREATE_OPERATOR_CLASS.html">CREATE OPERATOR CLASS</a>, <a href="./DROP_OPERATOR_FAMILY.html">DROP OPERATOR FAMILY</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',24)]))}const R=t(i,[["render",n]]);export{m as __pageData,R as default};
